#ASK #jwilder/nginx-proxy

Saya ada aplikasi yang akan di konterniasi menggunakan docker.
Untuk saat ini testing terdiri dari 2 container.
satu container apache+php dan yang kedua container isi nya mysql versi 5. Semua fitur aplikasi dapat berjalan, meski ada sedikit kendala pada salah satu fiur generete yang agak lama, dikarenakan memang aplikasi berat.

nah saat ini saya tambahkan container nginx proxy (jwilder/nginx-proxy) yang akan di gunakan untuk route ke host yang mana nya (dikarenakan kedepan akan ada multiple web apps listen port 80/443).
yang menjadi kendala sekarang adalah salah satu fitur aplikasi yang ada di container apache+php yaitu fitur generete menjadi tidak jalan sama sekali dengan error muncul di browser yaitu "504 Gateway Time-out
" saya sudah coba tambahkan parameter ini di config container nginx proxy nya  

      keepalive_timeout 300;
        keepalive_requests 50;
        proxy_read_timeout 600;
        proxy_connect_timeout 600;
        proxy_send_timeout 600;
        fastcgi_read_timeout 600;
        client_max_body_size 1000M;

tapi fitur generate report pada container apache+php tetap tidak error "504 Gateway Time-out"

ada yang bisa kasih pencerahan nya ??
